.multiselect-option-label {
  font-size: 0.875rem;
  font-weight: 500;
  color: #333;
}

.multiselect-option-desc {
  font-size: 0.75rem;
  color: #666;
  line-height: 1.3;
}

.multiselect-summary {
  margin-top: 0.5rem;
  padding: 0.5rem;
  background: #e3f2fd;
  border: 1px solid #90caf9;
  border-radius: 4px;
  font-size: 0.75rem;
  color: #1976d2;
  font-weight: 500;
  text-align: center;
}

.validation-errors {
  margin: 1rem;
  padding: 1rem;
  background: #ffebee;
  border: 1px solid #ffcdd2;
  border-radius: 4px;
}

.validation-errors h4 {
  font-size: 0.875rem;
  color: #c62828;
  margin-bottom: 0.5rem;
}

.validation-errors ul {
  list-style: none;
}

.validation-errors li {
  font-size: 0.8125rem;
  color: #d32f2f;
  margin-bottom: 0.25rem;
  padding-left: 1rem;
  position: relative;
}

.validation-errors li:before {
  content: "•";
  position: absolute;
  left: 0;
}

.examples {
  margin: 1rem;
  padding: 1rem;
  background: #f5f5f5;
  border-radius: 4px;
}

.examples h4 {
  font-size: 0.875rem;
  color: #333;
  margin-bottom: 0.75rem;
}

.example {
  margin-bottom: 1rem;
}

.example:last-child {
  margin-bottom: 0;
}

.example-description {
  font-size: 0.8125rem;
  color: #666;
  margin-bottom: 0.5rem;
  font-weight: 500;
}

.example-code {
  background: #fff;
  padding: 0.75rem;
  border-radius: 4px;
  font-size: 0.75rem;
  overflow-x: auto;
  border: 1px solid #e0e0e0;
}

.json-preview {
  background: #fff;
  border-top: 1px solid #e0e0e0;
  transition: all 0.3s;
}

.json-preview.collapsed {
  height: auto;
}

.json-preview.expanded {
  height: 300px;
  display: flex;
  flex-direction: column;
}

.json-preview-header {
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0.75rem 1rem;
  background: #fafafa;
  border-bottom: 1px solid #e0e0e0;
}

.json-preview-header h3 {
  font-size: 0.875rem;
  font-weight: 600;
  color: #333;
}

.json-preview-actions {
  display: flex;
  gap: 0.5rem;
}

.json-preview-actions button {
  padding: 0.25rem 0.75rem;
  background: #f5f5f5;
  border: 1px solid #e0e0e0;
  border-radius: 4px;
  cursor: pointer;
  font-size: 0.75rem;
  transition: all 0.2s;
}

.json-preview-actions button:hover {
  background: #e0e0e0;
}

.json-preview-content {
  flex: 1;
  overflow: auto;
  padding: 1rem;
  background: #1e1e1e;
}

.json-preview-content pre {
  margin: 0;
  font-family: Monaco, Menlo, Courier New, monospace;
  font-size: 0.8125rem;
  color: #d4d4d4;
  line-height: 1.5;
}

.command-palette::-webkit-scrollbar, .properties-panel::-webkit-scrollbar, .properties-content::-webkit-scrollbar, .json-preview-content::-webkit-scrollbar {
  width: 8px;
}

.command-palette::-webkit-scrollbar-track, .properties-panel::-webkit-scrollbar-track, .properties-content::-webkit-scrollbar-track, .json-preview-content::-webkit-scrollbar-track {
  background: #f5f5f5;
}

.command-palette::-webkit-scrollbar-thumb, .properties-panel::-webkit-scrollbar-thumb, .properties-content::-webkit-scrollbar-thumb, .json-preview-content::-webkit-scrollbar-thumb {
  background: #ccc;
  border-radius: 4px;
}

.command-palette::-webkit-scrollbar-thumb:hover, .properties-panel::-webkit-scrollbar-thumb:hover, .properties-content::-webkit-scrollbar-thumb:hover, .json-preview-content::-webkit-scrollbar-thumb:hover {
  background: #aaa;
}

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue, sans-serif;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  overflow: hidden;
}

code {
  font-family: source-code-pro, Menlo, Monaco, Consolas, Courier New, monospace;
}

#root {
  width: 100vw;
  height: 100vh;
}

